import {Link,useParams } from "react-router-dom";
import {useEffect,useState} from 'react'

function Projects({}){
    const [projects,setProjects] =useState([])
    useEffect(()=>{
        fetch('http://localhost:4000/projects')
        .then(r=>r.json())
        .then(data=> {
            setProjects(data)
        })
    },[])

    return (
    <div>
        Projects
    </div>
    )
}
export default Projects
